import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";

import InfoNavBar from "../infocomponents/InfoNavBar";
import HowToPlay from "../infocomponents/HowToPlay";
import CompanyProfiles from "../infocomponents/CompanyProfiles";
import Leaderboard from "../infocomponents/Leaderboard";
import Contact from "../infocomponents/Contact";

function Information() {
  return (
    <>
      <Router>
        <div className="App">
          <InfoNavBar />

          <Switch>
            

            <Route path="/information/how_to_play">
              <HowToPlay />
            </Route>

            <Route path="/information/company_profiles">
              <CompanyProfiles />
            </Route>

            <Route path="/information/leaderboard">
              <Leaderboard />
            </Route>

            <Route path="/information/contact">
              <Contact />
            </Route>
          </Switch>

        </div>
      </Router>
    </>
  );
}

export default Information;
